info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of Tenable io
  title: Tenable io
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Tenable.io Create a new scan in Tenable.io
      parameters:
      - description: The name of the scan
        example: Some Scan Name
        in: query
        name: Scan Name
        required: true
        schema: {type: string}
      - description: ID of a scan policy
        example: '13'
        in: body
        name: Scan Policy ID
        required: false
        schema: {type: string}
      - description: The name of the scanner to use
        example: US Cloud Scanner
        in: query
        name: Scanner Name
        required: false
        schema: {type: string}
      - description: A list of targets to scan.
        example: 192.168.1.1
        in: query
        name: Scan Targets
        required: false
        schema: {type: string}
      - description: The name of the scan template to use
        example: My Test Scan Template
        in: query
        name: Scan Template Name
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Tenable.io Create Scan
  tmp1:
    post:
      description: Export asset data from Tenable.io
      parameters:
      - description: To re-request an iterator based off of an existing export, pass
          the UUID of the export to bypass the initial request and instead use the
          UUID passed to build the export iterator.
        example: 1befc17f-c124-4083-b835-ee33ca986d84
        in: query
        name: UUID
        required: false
        schema: {type: string}
      - description: If True, returns only assets that have plugin results
        example: 'True'
        in: query
        name: Has Plugin Results
        required: false
        schema: {type: boolean}
      - description: Returns all assets terminated after the specified timestamp.
        example: '2019-12-18T14:47:35-06:00'
        in: query
        name: Terminated At
        required: false
        schema: {type: string}
      - description: Returns all assets created after the specified timestamp.
        example: '2019-12-18T14:47:35-06:00'
        in: query
        name: Created At
        required: false
        schema: {type: string}
      - description: Returns all assets last assessed after the specified timestamp.
        example: '2019-12-18T14:47:35-06:00'
        in: query
        name: Last Assessed
        required: false
        schema: {type: string}
      - description: Returns all assets first scanned after the specified timestamp.
        example: '2019-12-18T14:47:35-06:00'
        in: query
        name: First Scan Time
        required: false
        schema: {type: string}
      - description: Returns all assets updated after the specified timestamp.
        example: '2019-12-18T14:47:35-06:00'
        in: query
        name: Updated At
        required: false
        schema: {type: string}
      - description: Returns assets that have the specified source.
        example: CVE
        in: query
        name: Sources
        required: false
        schema: {type: string}
      - description: Specifies the number of objects returned per-chunk.  Default
          is 1000
        example: '1000'
        in: body
        name: Chunk Size
        required: false
        schema: {type: string}
      - description: Returns all assets last authenticated scan after the specified
          timestamp.
        example: '2019-12-18T14:47:35-06:00'
        in: query
        name: Last Authenticated Scan Time
        required: false
        schema: {type: string}
      - description: If set to True, will return only assets that have a ServiceNow
          Sys ID
        example: ''
        in: query
        name: ServiceNow Sys ID
        required: false
        schema: {type: boolean}
      - description: Returns all assets deleted after the specified timestamp.
        example: '2019-12-18T14:47:35-06:00'
        in: query
        name: Deleted At
        required: false
        schema: {type: string}
      - description: List of tag key-value pairs that must be associated to the asset
          data to be returned.
        example: Internal
        in: query
        name: Tags
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: Tenable.io Export Asset Information
  tmp10:
    post:
      description: Tenable.io Retrieve a list of assets
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp10'}
          description: Successful request
      summary: Tenable.io List Assets
  tmp11:
    post:
      description: Tenable.io Get a list of available plugin families
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp11'}
          description: Successful request
      summary: Tenable.io List Plugin Families
  tmp12:
    post:
      description: Tenable.io Retrieve a list of scans
      parameters:
      - description: Tenable.io Scan Folder ID
        example: '12'
        in: body
        name: Tenable.io Scan Folder ID
        required: false
        schema: {type: string}
      - description: Returns scans that have been modified since the time specified.
        example: '2019-06-03T15:51:27.112988-05:00'
        in: query
        name: Last Modified Datetime
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp12'}
          description: Successful request
      summary: Tenable.io List Scans
  tmp13:
    post:
      description: Tenable.io Retrieve host details from a specific scan
      parameters:
      - description: ID of the host during a scan
        example: '2'
        in: query
        name: Host ID
        required: true
        schema: {type: string}
      - description: ID of a scan
        example: '12'
        in: query
        name: Scan ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp13'}
          description: Successful request
      summary: Tenable.io Retrieve Host Details from Scan
  tmp2:
    post:
      description: Tenable.io Export a scan report
      parameters:
      - description: 'File format to export - options: nessus,csv,html,pdf,db'
        example: pdf
        in: query
        name: Export File Format
        required: false
        schema: {type: string}
      - description: ID of a scan
        example: '12'
        in: query
        name: Scan ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: Tenable.io Export Scan Report
  tmp3:
    post:
      description: Tenable.io Get details about an asset
      parameters:
      - description: FQDN Hostname
        example: demo.swimlane.io
        in: query
        name: Hostname
        required: false
        schema: {type: string}
      - description: IP Address
        example: 192.168.1.1
        in: query
        name: IP Address
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: Tenable.io Get Asset Details
  tmp4:
    post:
      description: Tenable.io Get details about a specific plugin ID
      parameters:
      - description: Plugin ID Number
        example: '19506'
        in: body
        name: Plugin ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp4'}
          description: Successful request
      summary: Tenable.io Get Plugin Details
  tmp5:
    post:
      description: Tenable.io Get details about a specific plugin family
      parameters:
      - description: Plugin Family ID
        example: '1'
        in: query
        name: Plugin Family ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp5'}
          description: Successful request
      summary: Tenable.io Get Plugin Family Details
  tmp6:
    post:
      description: Tenable.io Retrieve the latest or historical scan results
      parameters:
      - description: ID of a specific historical scan
        example: '2'
        in: query
        name: Scan History ID
        required: false
        schema: {type: string}
      - description: ID of a scan
        example: '12'
        in: query
        name: Scan ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp6'}
          description: Successful request
      summary: Tenable.io Get Scan Results
  tmp7:
    post:
      description: Tenable.io Get scan status
      parameters:
      - description: ID of a scan
        example: '12'
        in: query
        name: Scan ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp7'}
          description: Successful request
      summary: Tenable.io Get Scan Status
  tmp8:
    post:
      description: Tenable.io Export vulnerabilities from Tenable.io managed scans
      parameters:
      - description: Filter results based on CIDR range
        example: 0.0.0.0/8
        in: query
        name: CIDR Range
        required: false
        schema: {type: string}
      - description: Filter results based on first found as a Unix timestamp integer
        example: '1569275503'
        in: body
        name: First Found
        required: false
        schema: {type: string}
      - description: Filter results based on last fixed as a Unix timestamp integer
        example: '1569275503'
        in: body
        name: Last Fixed
        required: false
        schema: {type: string}
      - description: Filter results based on last found as a Unix timestamp integer
        example: '1569275503'
        in: body
        name: Last Found
        required: false
        schema: {type: string}
      - description: The total number of assets to return. Default is 50.  Max is
          5000
        example: '4999'
        in: body
        name: Number of Assets
        required: false
        schema: {type: string}
      - description: Filter results based on a plugin family
        example: Web Clients
        in: query
        name: Plugin Family
        required: false
        schema: {type: string}
      - description: Filter results based on severity. Options are 'info', 'low',
